import { Fragment } from "react"
import { useState,useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Article from "./backend_component/article";
import Sidebar from "./backend_component/sidebar";
import Title from "./backend_component/title";
import Admin from "./admin";
import Personal from "./personal";
import Manager from "./manager";

const Backend=()=>{
    var token=window.sessionStorage.getItem('token')
    var permession=window.sessionStorage.getItem('permession')
    const navigate=useNavigate()
    function select_permession(){
        if(token){
            if(permession==="admin"){
                return(<Admin/>)

            }
            else if(permession==="manager"){
                return(<Manager/>)
            }
            else{
                return(<Personal/>)
            }
        }
        else{
            navigate('/')
        }

    }
    useEffect(()=>{
        if(!token){navigate("/")}
      })

    return(
        <Fragment>
            {
                select_permession()
            }

        </Fragment>
    )
}
export default Backend;
